import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product card to be visible
    await page.waitForSelector('.product-card', { state: 'visible', timeout: 5000 });

    // Find the first product card element
    const firstProductCard = page.locator('.product-card').first();

    // Screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click.png'));

    // Click the product card to open the modal
    await firstProductCard.click();

    // Wait for the modal to appear and be visible
    const modalSelector = '#productModal[style*="display: block"]';
    await page.waitForSelector(modalSelector, { state: 'visible', timeout: 5000 });

    // Screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_open.png'));

    // Extract data from the modal to verify
    const productTitle = await page.locator(`${modalSelector} .product-detail-title`).textContent();
    const productPrice = await page.locator(`${modalSelector} .product-detail-price`).textContent();

    return {
      success: true,
      action: "Opened the product detail modal by clicking the first product card.",
      extractedData: {
        productTitle: productTitle.trim(),
        productPrice: productPrice.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
    screenshots.push(path.join(screenshotsDir, 'error_screenshot.png'));

    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
